import React from 'react';

const AboutScreen = ({ history }) => {
	return (
		<div className="container">
			<div className="about-section">
				<div className="shop-info">
					<img
						src="/images/aboutUs.jpg"
						style={{ width: '250px', height: '2000px' }}
					/>
				</div>

				<div className="shop-details">
					<h1> Hi! I'm Samantha Walters</h1>
					<p> Hi, my name is Sirapa, nice to meet you!</p>
					<p>
						{' '}
						I work with motivated spirits just like yours that want to quit
						their 9 to 5 jobs and embrace the entrepreneurial adventure.{' '}
					</p>
					<p>
						{' '}
						Do you have a business or an idea you are passionate about but you
						don't have the knowledge or time to create the web material and
						strategy you need?
					</p>
					<p>
						{' '}
						No worries! I have created a group of like-minded people to help you
						grow your business online. Everything is about you and what you want
						to do, I am only here to guide you and support you to make you
						realise your dreams!{' '}
					</p>
				</div>
			</div>
		</div>
	);
};

export default AboutScreen;
